import React from 'react';
import {
  BrowserRouter,
  Router,
  Route
} from "react-router-dom";

import Home from './components/Home';

function App() {
  return (
    <Router>

      <Route path="/" components={Home}></Route>

    </Router>
  );
}

export default App;
